sentence:
TTC testing shows those wrenches to be pretty weak. Not sure if they’ll be good for much more than spark plugs or a bracket bolt.

IIRC, @atikovi had one and was unimpressed.

@Trav has used his a lot more than I've used mine, but it hasn't let me down yet. It had no problem removing starter bolts, and doing a recent brake and rotor job for a friend. I used the Aircat for the clutch, job but I'm sure it would have been up to the task for that too. Like anything tools, there are several options, this shines when you need something with a flex-head.

